eval("(function() {\n\n'use strict';\n\nwindow.App.ApplicationRoute = Ember.Route.extend({\n\n\tactions: {\n\n\t\tlogout: function() {\n\t\t\tvar self = this;\n\n\t\t\tEmber.run(function() {\n\n\t\t\t\tself.controllerFor('home.login').reset();\n\t\t\t\tlocalStorage.removeItem('token');\n\t\t\t\tApp.Modules.Storage.set('authToken', null);\n\t\t\t\tself.transitionTo('home.login');\n\n\t\t\t});\n\t\t},\n\n\t\tchangeLanguage: function(language) {\n\n\t\t\tif(App.Modules.Storage.authToken) {\n\n\t\t\t\tvar user = App.User.create(App.Modules.Storage.authToken.user);\n\n\t\t\t\tuser.set('language', language);\n\t\t\t\tuser.save()\n\t\t\t\t\t.then(function succesfullyChangedLanguage() {\n\n\t\t\t\t\t\tlocalStorage.setItem('language', language);\n\t\t\t\t\t\twindow.location.reload();\n\n\t\t\t\t\t},\n\n\t\t\t\t\tfunction errorChangingLanguage() {\n\n\t\t\t\t\t\tlocalStorage.setItem('language', language);\n\t\t\t\t\t\twindow.location.reload();\n\n\t\t\t\t\t}\n\t\t\t\t);\n\n\t\t\t} else {\n\n\t\t\t\tlocalStorage.setItem('language', language);\n\t\t\t\twindow.location.reload();\n\n\t\t\t}\n\n\n\t\t},\n\n\t\terror: function() {\n\t\t\tconsole.log('An error has occured:', arguments);\n\t\t}\n\t}\n});\n\n})();//@ sourceURL=client/app/routes/ApplicationRoute.js")

eval("(function() {\n\n'use strict';\n\nApp.LoadingRoute = Ember.Route.extend({});\n\nApp.AuthRoute = Ember.Route.extend(Ember.Evented, {\n\n\tbeforeModel: function(transition) {\n\n\t\tif(! localStorage.getItem('token')) {\n\t\t\tvar loginController = this.controllerFor('home.login');\n\t\t\tloginController.set('attemptedTransition', transition);\n\t\t\tthis.transitionTo('home.login');\n\t\t}\n\n\t},\n\n\tmodel: function() {\n\t\treturn {};\n\t},\n\n\tsetupController: function(controller, model) {\n\n\t\tcontroller.set('user', model.user);\n\t\tcontroller.set('messages', model.messages);\n\n\t},\n\n\tcloseConfirmPopup: function() {\n\n\t\tthis.disconnectOutlet({\n\t\t\toutlet:     'confirmDialog',\n\t\t\tparentView: 'auth'\n\t\t});\n\n\t},\n\n\tactions: {\n\n\n\t\tchangeCompany: function(companyId) {\n\n\t\t\tvar self = this;\n\n\t\t\tApp.AuthToken.switchCompany(companyId).then(function succesfullyChangedCompany() {\n\n\t\t\t\tself.transitionTo('book');\n\n\t\t\t});\n\n\t\t},\n\n\t\topenTips: function(type) {\n\n\t\t\tvar template = '';\n\t\t\tswitch(type) {\n\n\t\t\t\tcase 'admin':\n\t\t\t\t\ttemplate = 'auth/adminTips';\n\t\t\t\t\tbreak;\n\n\t\t\t\tcase 'user':\n\t\t\t\t\ttemplate = 'auth/userTips';\n\t\t\t\t\tbreak;\n\n\t\t\t}\n\n\t\t\tthis.render(template, {\n\t\t\t\tinto:   'auth',\n\t\t\t\toutlet: 'tips'\n\t\t\t});\n\n\t\t},\n\n\t\tcloseTips: function(type) {\n\n\t\t\tvar template = '';\n\t\t\tswitch(type) {\n\n\t\t\t\tcase 'admin':\n\t\t\t\t\ttemplate = 'auth/adminTips';\n\t\t\t\t\tbreak;\n\n\t\t\t\tcase 'user':\n\t\t\t\t\ttemplate = 'auth/userTips';\n\t\t\t\t\tbreak;\n\n\t\t\t}\n\n\t\t\tthis.disconnectOutlet({\n\t\t\t\tparentView: 'auth',\n\t\t\t\toutlet:     'tips'\n\t\t\t});\n\n\t\t\tthis.controllerFor('auth').send('removeTask', 'ShowAdminTutorial');\n\n\t\t\tthis.transitionTo('admin');\n\n\t\t},\n\n\t\terror: function(err) {\n\n\t\t\tvar self = this;\n\n\t\t\tif(err.status === 401) {\n\n\t\t\t\tthis.controllerFor('home.login').set('requestError', 'unauthorized');\n\t\t\t\tthis.controllerFor('home.login').set('token', null);\n\t\t\t\tthis.controllerFor('home.login').reset();\n\t\t\t\tlocalStorage.removeItem('token');\n\n\t\t\t\tthis.transitionTo('home.login');\n\n\t\t\t} else if(err.status === 403) {\n\n\t\t\t\tthis.controllerFor('auth').send('showNotificationByCode', 'forbidden');\n\n\t\t\t} else if(err.status === 426) {\n\t\t\t\t// front end was updated\n\t\t\t\twindow.location.reload();\n\n\t\t\t} else if(err.status === 498) {\n\t\t\t\t// back end was updated\n\t\t\t\tApp.AuthToken.refreshToken().then(function() {\n\n\t\t\t\t\tself.controllerFor('auth').send('showNotificationByCode', 'backendUpdated');\n\n\t\t\t\t});\n\n\t\t\t} else if(err.statusText === 'timeout') {\n\n\t\t\t\tthis.controllerFor('auth').send('showNotificationByCode', 'timeout');\n\n\t\t\t} else if(err.status === 0) {\n\n\t\t\t\tthis.controllerFor('home.login').set('requestError', 'connectionError');\n\t\t\t\tthis.controllerFor('home.login').set('token', null);\n\t\t\t\tlocalStorage.removeItem('token');\n\n\t\t\t\tthis.transitionTo('home.login');\n\n\t\t\t}\n\t\t\telse {\n\n\t\t\t\tif(err.transition) {\n\t\t\t\t\tthis.transitionTo(err.transition);\n\t\t\t\t}\n\t\t\t\tif(err.message) {\n\t\t\t\t\tthis.controllerFor('auth').send('showNotificationByCode', 'generalError', {\n\t\t\t\t\t\tcontent: err.message\n\t\t\t\t\t});\n\t\t\t\t\tconsole.log(err);\n\t\t\t\t\tconsole.log(err.stack);\n\t\t\t\t}\n\n\t\t\t}\n\t\t},\n\n\t\tconfirmYes: function() {\n\t\t\tvar confirmObj = this.get('confirmObj');\n\t\t\tconfirmObj.confirmCallback.call(confirmObj.caller);\n\t\t\tthis.closeConfirmPopup();\n\t\t},\n\n\t\tconfirmNo: function() {\n\t\t\tvar confirmObj = this.get('confirmObj');\n\t\t\tif(confirmObj.discardCallback) {\n\t\t\t\tconfirmObj.discardCallback.call(confirmObj.caller);\n\t\t\t}\n\t\t\tthis.closeConfirmPopup();\n\t\t},\n\n\t\tconfirm: function(text, caller, confirmCallback, discardCallback) {\n\n\t\t\tthis.set('confirmObj', {\n\t\t\t\tconfirmCallback: confirmCallback,\n\t\t\t\tdiscardCallback: discardCallback,\n\t\t\t\tcaller:          caller\n\t\t\t});\n\n\t\t\tthis.controllerFor('auth').set('dialogText', Ember.I18n.t(text));\n\n\t\t\tthis.render('auth/confirmDialog', {\n\t\t\t\tinto:   'auth',\n\t\t\t\toutlet: 'confirmDialog'\n\t\t\t});\n\n\t\t},\n\n\t\topenPopup: function(popup) {\n\n\t\t\tthis.get('controller').trigger('openPopup', popup);\n\n\t\t}\n\t}\n});\n\n})();//@ sourceURL=client/app/routes/AuthRoute.js")

